const Themes = {
    blue : {
      mainColor: "#0069bb",
      hoverColor: "#2089DB",
      defalutColor: "#9F9F9F",
      backgroundColor : "white",
      border: "0px solid #404040",
      fillColor: "white",
      logoBackgroundColor: "#0069bb"
    },
    dark : {
      mainColor: "white",
      backgroundColor : "black",
      defalutColor: "#9F9F9F",
      border: "1px solid #404040",
      fillColor: "white",
      logoBackgroundColor: "black"
    }
}

export default Themes;
